import { heading,sortby } from "./constants/Grid.constants.Heading";
function Grid(props) {
  const rows = cardNumber(props.categorizedItems)
  return (
    <div className="menu">
      <SortBy children={heading} sort={sortby}/>
      <div className="card">
        {
        showMappedRow(rows)
        }
      </div>
      {console.log(props.categorizedItems)}
    </div>
  );
}

